import React from "react";

const Vaardigheden = (props) => {

    const useState = props.useState
    const vaardigheden = props.vaardigheden

    return<>
    <form>
        <label htmlFor="vaardigheidEen"> eerste vaardigheid </label>
        <input
        onChange={''}
        value={vaardigheden.een}
        type='text'
        id="vaardigheidEen"
        />

        <label htmlFor="vaardigheidTwee"> tweede vaardigheid </label>
        <input
        onChange={''}
        value={''}
        type='text'
        id="vaardigheidTwee"
        />

        <label htmlFor="vaardigheidDrie"> derde vaardigheid </label>
        <input
        onChange={''}
        value={''}
        type='text'
        id="vaardigheidDrie"
        />

        <label htmlFor="vaardigheidVier"> vierde vaardigheid </label>
        <input
        onChange={''}
        value={''}
        type='text'
        id="vaardigheidVier"
        />

        <label htmlFor="vaardigheidVijf"> vijfde vaardigheid </label>
        <input
        onChange={''}
        value={''}
        type='text'
        id="vaardigheidVijf"
        />
    </form>
    </>
}

export default Vaardigheden;
